         />
         <TextField 
        name="amount" 
        variant="outlined" 
        label="Amount" 
        fullWidth 
        value={postData.title} 
        onChange={(e) => setPostData({ ...postData, title: e.target.value })}
         />
         <TextField 
        name="bankName" 
        variant="outlined" 
        label="Name of the bank" 
        fullWidth 
        value={postData.title} 
        onChange={(e) => setPostData({ ...postData, title: e.target.value })}
         />
         <TextField 
        name="accountNumber" 
        variant="outlined" 
        label="Account Number" 
        fullWidth 
        value={postData.title} 
        onChange={(e) => setPostData({ ...postData, title: e.target.value })}
         />
    <TextField 
        name="typeOfAccount" 
        variant="outlined" 
        label="Type of Account" 
        fullWidth 
        value={postData.title} 
        onChange={(e) => setPostData({ ...postData, title: e.target.value })}
         />
       <Button type="submit">Submit</Button>
      </form>
    </Paper>
  )
}

export default Claim
